    # With more than one possible game this could be extended to include 2+ players
    p = 0
    for i in range(1, n + 1):
        # Counting starts from the folded hands of player 1
        num_fists = 1
        while num_fists < s:
            if i == 1:
                # If the current player has folded his hands, he becomes the one who starts counting
                num_fists += i
                p += 1
                break
            else:
                if i == 2:
                    num_fists = i
                    p += 1
                    break
                else:
                    if i % 2 == 0:
                        # If the current player's hand is not folded, he has to turn it upside down
                        num_fists += i // 2
                        i //= 2
                    else:
                        # If the current player's hand is folded, he has to split his fists and then start counting
                        num_fists = i // 2
                        i = i // 2
    return str(p)

