def solution(stdin: str) -> str:
    '''
    Given the name of the file containing the log of a contest, return a list of the names of the problems solved in order of time. Each problem is represented by the letter of its designation, plus its time score (minus penalties) if any.
    '''
    teams = {}
    time_score = 0
    max_time = 0
    prev_time = 0
    for line in stdin.splitlines():
        if line == '-1':
            return str(time_score)
        elif line[0] == '-':
            if line[1] in teams:
                teams[line[1]]['penalty'] += 1
                teams[line[1]]['time'] += (prev_time - teams[line[1]]['time_score'])
            else:
                teams[line[1]] = {'penalty': 1, 'time': 0, 'time_score': prev_time, 'name': line[1]}
            time_score = 0
            max_time = max(max_time, teams[line[1]]['time'])
        else:
            name = line[1]
            time = int(line[0])
            if time > prev_time:
                time_score = time - prev_time
            else:
                time_score = 0
            max_time = max(max_time, time)
            if name in teams:
                teams[name]['penalty'] += 1
                teams[name]['time'] += (time - teams[name]['time_score'])
                teams[name]['time_score'] = time
            else:
                teams[name] = {'penalty': 1, 'time': 0, 'time_score': time, 'name': name}
            prev_time = time
    for name in teams:
        teams[name]['penalty'] += 1
        teams[name]['time'] += (max_time - teams[name]['time_score'])
    for name in teams:
        time_score += teams[name]['penalty']
    return str(time_score)

